import { LoadingOutlined } from '@ant-design/icons'
import React from 'react'
import { btnBackgroundColor } from '../../uiConfig'

export default function Viewer(props) {
  return (
    <div style={{width: '90%', display: 'inline-block', border: `1px solid ${btnBackgroundColor}`, padding: '20px'}} align="left">
            <span style={{paddingRight: '20px', paddingBottom: '5px', borderBottom: `2px solid ${btnBackgroundColor}`, fontSize: '17px'}}>{props.title}</span>
             <br/>
             <br/>
            {props.loading ? <LoadingOutlined /> : <div style={{height: '60%', overFlowY: 'scroll'}}  dangerouslySetInnerHTML={{__html: props.rawHtmlBody}}></div>}
    </div>
  )
}
